import{_ as a,c as t,o as i,ag as o}from"./chunks/framework.D22YC4c3.js";const m=JSON.parse('{"title":"Get started with your survey","description":"","frontmatter":{},"headers":[],"relativePath":"guide/get-started.md","filePath":"guide/get-started.md"}'),s={name:"guide/get-started.md"};function l(r,e,n,d,u,c){return i(),t("div",null,[...e[0]||(e[0]=[o('<h1 id="get-started-with-your-survey" tabindex="-1">Get started with your survey <a class="header-anchor" href="#get-started-with-your-survey" aria-label="Permalink to &quot;Get started with your survey&quot;">​</a></h1><p>If you are accessing your survey for the first time, log in here: <a href="https://admin.intake24.org" target="_blank" rel="noreferrer">admin.intake24.org</a> and follow the on-screen instructions to set your new password. You will not need to repeat this step.</p><p>Once in the Intake24 admin tool, click on <code>Surveys</code> in sidebar. Next to your survey, click on the detail icon.</p><p>To get started with using Intake24, read and follow all the instructions in the sections below.</p><h2 id="detail" tabindex="-1">Detail <a class="header-anchor" href="#detail" aria-label="Permalink to &quot;Detail&quot;">​</a></h2><p>This tab summarises the set-up of your study, updates can be made in the <code>edit</code> tab. All fields are explained in the next section.</p><h2 id="edit" tabindex="-1">Edit <a class="header-anchor" href="#edit" aria-label="Permalink to &quot;Edit&quot;">​</a></h2><p>This tab is used to create your study in Intake24. The study set-up form sent to Cambridge is used to populate this tab.</p><p>There are a number of fields, listed below, which you are unable to edit. However, apart from <code>Survey ID</code> all fields can be modified by Cambridge if needed.</p><h3 id="survey-id" tabindex="-1">Survey ID <a class="header-anchor" href="#survey-id" aria-label="Permalink to &quot;Survey ID&quot;">​</a></h3><ul><li>Short string-based field which is included in the survey URL / authentication URLs</li><li>Once set, this can&#39;t be edited</li></ul><h3 id="locale" tabindex="-1">Locale <a class="header-anchor" href="#locale" aria-label="Permalink to &quot;Locale&quot;">​</a></h3><ul><li>The food data that will be used for the survey</li><li>This can be amended but will require further discussion</li></ul><h3 id="survey-scheme" tabindex="-1">Survey scheme <a class="header-anchor" href="#survey-scheme" aria-label="Permalink to &quot;Survey scheme&quot;">​</a></h3><ul><li>Recall questions forming the recall flow</li><li>This is set to pre-defined / default questions, additional questions can be added, please discuss</li></ul><h3 id="feedback-scheme" tabindex="-1">Feedback scheme <a class="header-anchor" href="#feedback-scheme" aria-label="Permalink to &quot;Feedback scheme&quot;">​</a></h3><ul><li>Can be enabled / disabled</li><li>If dietary feedback is switched on, feedback scheme needs to be set</li><li>As above, this is set to a default scheme but this can be customised</li><li>More information can be found in <a href="/admin/feedback/schemes.html">feedback scheme section</a></li></ul><hr><p>The remaining fields, listed below, can be edited freely by you/your study team:</p><h3 id="survey-name" tabindex="-1">Survey name <a class="header-anchor" href="#survey-name" aria-label="Permalink to &quot;Survey name&quot;">​</a></h3><ul><li>Name of survey appearing on recall</li></ul><h3 id="start-date" tabindex="-1">Start date <a class="header-anchor" href="#start-date" aria-label="Permalink to &quot;Start date&quot;">​</a></h3><ul><li>Start date of your survey</li></ul><h3 id="end-date" tabindex="-1">End date <a class="header-anchor" href="#end-date" aria-label="Permalink to &quot;End date&quot;">​</a></h3><ul><li>End date of your survey</li></ul><h3 id="support-email" tabindex="-1">Support email <a class="header-anchor" href="#support-email" aria-label="Permalink to &quot;Support email&quot;">​</a></h3><ul><li>Designated mailbox for your survey help requests</li></ul><h3 id="state" tabindex="-1">State <a class="header-anchor" href="#state" aria-label="Permalink to &quot;State&quot;">​</a></h3><ol><li><strong>Not started</strong> – survey has not started, respondents will not be able to complete recalls.</li><li><strong>Active</strong> – survey is LIVE, respondents are able to complete recalls</li><li><strong>Suspended</strong> – survey is paused, respondents are unable to complete recalls until survey is set to active again</li><li><strong>Completed</strong> – survey has finished data collection, respondents are unable to complete recalls.</li></ol><h3 id="store-user-session-on-server" tabindex="-1">Store user session on server <a class="header-anchor" href="#store-user-session-on-server" aria-label="Permalink to &quot;Store user session on server&quot;">​</a></h3><ul><li>If enabled, user partial submission data are sent to server for storage and retrieval</li><li>If disabled, user partial submission data are only stored locally</li><li>This is switched on by default</li></ul><h3 id="sorting-algorithm" tabindex="-1">Sorting algorithm <a class="header-anchor" href="#sorting-algorithm" aria-label="Permalink to &quot;Sorting algorithm&quot;">​</a></h3><p>Determines the order of foods displayed to respondent:</p><ol><li>Popularity (reporting frequency): returned food matched list based on popularity of selection – survey specific</li><li>Global popularity (reporting frequency): returned food matched list based on popularity of selection – all studies. This is our default setting.</li><li>Predetermined order: returned food matched list compiled by researcher and uploaded into Intake24</li></ol><h3 id="match-score-weight" tabindex="-1">Match score weight <a class="header-anchor" href="#match-score-weight" aria-label="Permalink to &quot;Match score weight&quot;">​</a></h3><ul><li>Match score weight parameter or sorting algorithm.</li><li>Our default score weight is 20</li></ul><h3 id="allow-user-personal-identifiers" tabindex="-1">Allow user personal identifiers <a class="header-anchor" href="#allow-user-personal-identifiers" aria-label="Permalink to &quot;Allow user personal identifiers&quot;">​</a></h3><ul><li>Can be enabled / disabled</li><li>If enabled, user can store values to email / phone / name fields on user records through the survey respondent UI (i.e. the UI will show this additional fields and also CSV upload will accept those columns to import)</li></ul><h3 id="allow-user-custom-fields" tabindex="-1">Allow user custom fields <a class="header-anchor" href="#allow-user-custom-fields" aria-label="Permalink to &quot;Allow user custom fields&quot;">​</a></h3><ul><li>Can be enabled / disabled</li><li>If enabled, user can store additional values in user custom fields, which is <code>key:value</code> pair.</li><li>This can e.g. be done using CSV file upload, any column name that is not matched with user fields, will get stored as custom field</li></ul><h3 id="captcha-verification" tabindex="-1">Captcha verification <a class="header-anchor" href="#captcha-verification" aria-label="Permalink to &quot;Captcha verification&quot;">​</a></h3><ul><li>Can be toggled on / off</li><li>If enabled, strengthens participant logins (username/password and authentication URLs) to better guard against potential bot activity</li></ul><h3 id="url-token-character-set" tabindex="-1">URL Token character set <a class="header-anchor" href="#url-token-character-set" aria-label="Permalink to &quot;URL Token character set&quot;">​</a></h3><ul><li>String of characters used for authentication tokens (related to redirecting respondents once recall(s) are complete)</li></ul><h3 id="url-token-length" tabindex="-1">URL Token length <a class="header-anchor" href="#url-token-length" aria-label="Permalink to &quot;URL Token length&quot;">​</a></h3><ul><li>Authentication token length, see <a href="/admin/surveys/#authentication-settings">authentication settings</a> for more information</li></ul><h3 id="url-domain-override" tabindex="-1">URL Domain override <a class="header-anchor" href="#url-domain-override" aria-label="Permalink to &quot;URL Domain override&quot;">​</a></h3><ul><li>URL override to used to generate full authentication links in CSV export file</li></ul><h3 id="allow-user-generation" tabindex="-1">Allow user generation <a class="header-anchor" href="#allow-user-generation" aria-label="Permalink to &quot;Allow user generation&quot;">​</a></h3><ul><li>Can be switched on / off, see <a href="/admin/surveys/#authentication-settings">authentication settings</a> for more information</li><li>This is switched off by default</li></ul><h3 id="jwt-secret-for-m2m-communication" tabindex="-1">JWT secret for M2M communication <a class="header-anchor" href="#jwt-secret-for-m2m-communication" aria-label="Permalink to &quot;JWT secret for M2M communication&quot;">​</a></h3><ul><li>String to sign JWT token</li></ul><h3 id="submission-notification-url" tabindex="-1">Submission notification URL <a class="header-anchor" href="#submission-notification-url" aria-label="Permalink to &quot;Submission notification URL&quot;">​</a></h3><ul><li>Webhook to be called when recall data is submitted</li><li>See <a href="/admin/surveys/#notifications">notifications settings</a> for more information</li></ul><h3 id="maximum-allowed-submissions-per-calendar-day" tabindex="-1">Maximum allowed submissions per calendar day <a class="header-anchor" href="#maximum-allowed-submissions-per-calendar-day" aria-label="Permalink to &quot;Maximum allowed submissions per calendar day&quot;">​</a></h3><ul><li>Maximum number of recalls that can be submitted in one day</li><li>This is set to 1 recall by default</li></ul><h3 id="maximum-allowed-total-submissions" tabindex="-1">Maximum allowed total submissions <a class="header-anchor" href="#maximum-allowed-total-submissions" aria-label="Permalink to &quot;Maximum allowed total submissions&quot;">​</a></h3><ul><li>Maximum number of recalls that can be submitted by same respondent</li></ul><h3 id="minimum-interval-between-submissions-seconds" tabindex="-1">Minimum interval between submissions (seconds) <a class="header-anchor" href="#minimum-interval-between-submissions-seconds" aria-label="Permalink to &quot;Minimum interval between submissions (seconds)&quot;">​</a></h3><ul><li>Shortest minimal interval between submissions by same respondent</li><li>Set to 600 secs by default</li></ul><h3 id="number-of-submissions-for-feedback" tabindex="-1">Number of submissions for feedback <a class="header-anchor" href="#number-of-submissions-for-feedback" aria-label="Permalink to &quot;Number of submissions for feedback&quot;">​</a></h3><ul><li>If feedback is switched on, this can be set to number of submissions required to allow respondent access to feedback</li></ul><h2 id="respondents" tabindex="-1">Respondents <a class="header-anchor" href="#respondents" aria-label="Permalink to &quot;Respondents&quot;">​</a></h2><p>This tab is used to upload usernames and passwords and generate survey URLs for survey participants. It`s recommended to upload usernames and passwords in bulk and in CSV format.</p><p>To bulk upload usernames and passwords:</p><p><strong>1) Compile a CSV file which includes at least <code>username</code> column</strong></p><p>The usernames should not contain any spaces (or personally identifiable information).</p><p>Please see <a href="/admin/system/job-types#surveyrespondentsimport">survey respondent import</a> for more details on CSV format.</p><p>If passwords are used, the minimum requirements for creating passwords are as follows:</p><ul><li>Minimum 10 character length (for both)</li><li>Character set to include both lower/upper letters [a-zA-Z] and digits [0-9]</li></ul><p>Usernames / passwords must NOT include personally identifiable information</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>If your CSV file with usernames and passwords is not uploading to Intake24 and you have carefully checked that the headings match those given above, it may be that your CSV file contains a <code>BOM</code> (byte order marking) character. To check and remove this, open the file in an editor that supports encoding (e.g. Notepad++). In Notepad++ if you see it says UTF-8 BOM in the bottom right corner of the screen, you can remove it by clicking <code>Encoding</code> on the top menu and then <code>UTF-8</code>. Save the file and try uploading this new version. If this does not work or if you encounter any further issues, contact your IT or technical department.</p></div><p><strong>2. Click on the three dots beside <code>new respondent</code> followed by <code>respondents upload</code></strong></p><p><strong>3. Click into field <code>CSV file to upload</code></strong></p><ul><li>This will open up your file directory</li><li>Choose the correct file and click open</li><li>The <code>CSV file to upload</code> field should be filled with file name</li><li>Click on <code>upload</code></li><li>Click <code>close</code> once the upload is complete – a green tick should appear beside the import job</li></ul><p><strong>4. Click into a different tab and then back into <code>respondents</code></strong></p><ul><li>This will update the tab to include the newly uploaded usernames</li></ul><p><strong>5. To generate survey URLs, follow step 2 but click on <code>Authentication URLs</code></strong></p><ul><li>Click <code>generate file</code></li><li>Once generated, you will be able to download the file. You can either circulate the <code>ShortSurveyAuthenticationURL</code> or <code>SurveyAuthenticationURL</code>, see <a href="/admin/surveys/#respondents">survey submissions</a> for more details.</li><li>Respondents will not require their usernames and passwords to log-in, instead the URL can be used for Intake24 recall access</li><li>To manually create new respondents, click on <code>new respondent</code> and complete all fields</li><li>Finally click <code>save</code></li><li>Remember to not include any personal identifiable information</li><li>Repeat step 5 to generate log-in URLs for new respondents</li></ul><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Please note that it is your responsibility to test your survey prior to starting data collection.</p></div><h2 id="submissions" tabindex="-1">Submissions <a class="header-anchor" href="#submissions" aria-label="Permalink to &quot;Submissions&quot;">​</a></h2><p>This tab allows you to view / filter / delete submissions. You can filter the results by <code>username</code>. Any deletions made in this tab will automatically update the data export.</p><h2 id="tasks" tabindex="-1">Tasks <a class="header-anchor" href="#tasks" aria-label="Permalink to &quot;Tasks&quot;">​</a></h2><p>This tab allows you to import/extract the following reports:</p><ul><li><code>Survey – Export authentication URLs</code> - export log-in credentials</li><li><code>Survey – Submission data export</code> - export survey submission data to CSV file</li><li><code>Survey – Nutrients recalculation</code> - recalculates survey submission nutrient data</li><li><code>Survey – Ratings export</code> - export survey dietary feedback ratings (please note, both dietary feedback and the ratings feature will need to be enabled in order to collect this information)</li><li><code>Survey – Import respondents</code> - import usernames and passwords</li></ul>',85)])])}const b=a(s,[["render",l]]);export{m as __pageData,b as default};
